import Video from './components/Video'
import "./App.css"

function App() {

  let videos = [{
    id: 1,
    title: "Node JS tutorials",
    views: "100K",
    time: "2 months ago",
    channel: "coder dost",
    verified: true
  },
  {
    id: 2,
    title: "Express JS tutorials",
    views: "400K",
    time: "2 years ago",
    channel: "coder dost",
    verified: false
  },
  {
    id: 3,
    title: "Django tutorials",
    views: "1M",
    time: "3 months ago",
    channel: "coder dost",
    verified: false
  },
  {
    id: 4,
    title: "React tutorials",
    views: "50K",
    time: "7 months ago",
    channel: "coder dost",
    verified: true
  }
];

  return (
    <div className="App">
      <div>Videos</div>
      {
        videos.map(video=><Video
          title={video.title}
          views={video.views}
          time={video.time}
          channel={video.channel}
          verified={video.verified}
          >
        </Video>)
      }
    </div>
  )
}

export default App;
